import { Link } from 'react-router-dom';
import Element from "./DashElement";
import axios from 'axios';
import { useState, useEffect } from 'react';
import ebayLogo from '../images/ebay-logo.png'
import Loading from './Loading';
import Listings from './Activelistings';

const serverUrl = 'http://localhost:8080'

function UserDashboard(props) {

    const [ userData, setUserData ] = useState();

    useEffect(() => {
        async function fetchData(){
            await axios.get(serverUrl + '/getlistings')
                .then(res => {
                    console.log(res.data);
                    let dataArray = res.data.GetMyeBaySellingResponse.ActiveList.ItemArray.Item
                    setUserData(dataArray);   
                    console.log(dataArray);
                    console.log(userData);
                })
            .catch(err => console.log(err))
        }
        fetchData();

    },[]);

    async function getImages(url) {
        await axios.post(serverUrl + '/getimage', {
          imageUrl: url
        })
        .then(function(res) {
            console.log(res)
        })
        .catch(function (error) {
            console.log(error);
          });
    }

    props.funcNav('usr');

    var date = new Date();
    var year = date.getFullYear();
    var month = date.getMonth();
    var day = date.getDate();
    var hours = date.getHours();
    var ampm = hours >= 12 ? 'pm' : 'am';
    const today = month + " - " + day + " - " + year;

    const weekDay = () => {
        const weekday = ["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];
        let day = weekday[date.getDay()];
        // console.log(day);
        // console.log(hours);
        return day;
    };

    const greeting = () => {
        if(ampm === 'am') return 'Good Monring'
        if(ampm === 'pm' && hours < 17) return 'Good Afternoon'
        if(ampm === 'pm' && hours >= 17) return 'Good Evening'
    }

    function bidcount(bids) {
       if (bids.hasOwnProperty('BidCount')) {
        return bids.BidCount._text
       } else {
        return '0'
       }
    }
    function watchcount(data) {
        if(data.hasOwnProperty('WatchCount')){
            return data.WatchCount._text
        } else {
            return '0'
        }
    }
    function listed(data) {
        let fixed = data.substring(0, 10);
        return fixed
    }

    function time(data){
        let fixed = data.replace('D', 'd ').replace('H', 'h ').replace('M', 'min ').replace('S', 'sec').slice(1).split('T')
        return fixed
    }

    f

    return (
        <>
            <div className="user-dash">
                <div className="row">
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title={greeting()}
                            subtitle='Timothy'
                            text={(
                                <>
                                <div>
                                    <b>
                                        {weekDay()}
                                    </b>   
                                </div>
                                <div className='date'>
                                    {today}
                                </div>
                                </>
                                )}
                        />
                    </div>
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title='Consignments'
                            subtitle='Total Items Listed'
                            text={(
                                <>
                                <div className="dash-header-num">
                                    53
                                </div>
                                </>
                            )}
                            link={(
                                <>
                                    view more
                                </>
                            )}
                        />
                    </div>
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title='Sold'
                            subtitle='Total Items Sold'
                            text={(
                                <>
                                <div className="dash-header-num">
                                    35
                                </div>
                                </>
                            )}
                            link={(
                                <>
                                    view more
                                </>
                            )}
                            to=''
                        />
                    </div>
                    <div className="col">
                        <Element
                            class='dash-header' 
                            title='Credit'
                            subtitle='Balance'
                            text={(
                                <>
                                <div className="dash-header-num">
                                    $ 1,235.50
                                </div>
                                </>
                            )}
                            link={(
                                <>
                                    view more
                                </>
                            )}
                        />
                    </div>
                </div>
                <div className="row">
                    <div className="col">
                        <Element
                            class='dash-main' 
                            title='CONSIGNMENTS'
                            text=''
                            body={
                                <Listings/>
                            }
                        /> 
                    </div>
                </div>
            </div>
        </>
    )
}

export default UserDashboard;
